import React from "react";
import { Typography, Box, Container } from "@mui/material";

function Home() {
  return (
    <Container sx={{ maxWidth: "100%", padding: "0" }}>
      <Box
        sx={{
          marginTop: "50px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Typography
          variant="h1"
          sx={{
            fontFamily: "Rubik",
            fontSize: "6rem",
            color: "lightblack",
          }}
        >
          Welcome To SuperSonics
        </Typography>
      </Box>
    </Container>
  );
}

export default Home;
